&quot;In March 2013, Lucasfilm announced that Star Wars: The Clone Wars would be &quot;winding down&quot;. While new &quot;story arcs&quot; are still in development, the series has been effectively cancelled. Lucasfilm has referred to the remaining produced episodes as &quot;bonus content&quot;, stating that further information would be forthcoming on how these episodes will be made available to the public.&quot;


